-- =============================================================================
-- SEASON RESET: Clear all run data before seeding Season 2
-- =============================================================================
-- Order: dependent tables first, then parent tables

-- Run data (partitioned tables - DELETE is safer than TRUNCATE for partitions)
DELETE FROM public.runs;
DELETE FROM public.run_history;
DELETE FROM public.daily_stats;

-- Hex data
DELETE FROM public.hex_snapshot;
DELETE FROM public.hexes;

-- Stats & leaderboard
DELETE FROM public.daily_buff_stats;
DELETE FROM public.daily_province_range_stats;
DELETE FROM public.daily_all_range_stats;
DELETE FROM public.season_leaderboard_snapshot;

-- Reset user season aggregates (keep profile: name, manifesto, sex, birthday, nationality)
UPDATE public.users SET
  season_points = 0,
  total_distance_km = 0,
  avg_pace_min_per_km = NULL,
  avg_cv = NULL,
  total_runs = 0,
  cv_run_count = 0,
  team = NULL,
  season_home_hex = NULL;

-- Remove seed users from previous runs (if re-running migration)
DELETE FROM public.users WHERE id IN (
  SELECT u.id FROM public.users u
  JOIN auth.users a ON u.auth_id = a.id
  WHERE a.email LIKE '%@seed.local'
);
DELETE FROM auth.identities WHERE user_id IN (
  SELECT id FROM auth.users WHERE email LIKE '%@seed.local'
);
DELETE FROM auth.users WHERE email LIKE '%@seed.local';

